import React from 'react'
import { Link } from 'react-router-dom';

import style from "./VehicleCard.module.css"
import { AiOutlineHeart } from 'react-icons/ai';
import { AiFillHeart } from 'react-icons/ai';


export const VehicleCard = ({id, uid, favorite, vehicle, favoriteFuntion}) => {
  const {model, max_atmosphering_speed, crew, cargo_capacity} = vehicle;

  return (
    <div className={`${style.card} card g-col-12 g-col-sm-6 g-col-lg-3`}>
      <img src={`https://starwars-visualguide.com/assets/img/vehicles/${uid}.jpg`} className={`${style.cardImgTop} card-img-top`} />
      
      <div className={`${style.cardBody} card-body`}>
        <h5 className={`${style.cardTitle} card-title`}>{model}</h5>
        
        <div className={`${style.cardText} card-text`}>
          <p><b>Speed:</b> {max_atmosphering_speed}km/h</p>
          <p><b>Passengers:</b> {crew} </p>
          <p><b>Cargo capacity:</b> {cargo_capacity} tons</p>
        </div>
        
        <div className={`${style.containerButtons} container-Buttons`}>
          <Link to={`/vehicle/${id}`} className="btn btn-dark">View more!</Link>
          {
            favorite
            ?<AiFillHeart className={style.iconCard} onClick={()=>favoriteFuntion(id)} />
            :<AiOutlineHeart className={style.iconCard} onClick={()=>favoriteFuntion(id)} />
          }
        </div>
        
      </div>
    </div>
  )
}
